import React from 'react';

function FeedbackCard(props){
	return(
		<div className='FeedbackCard'>
			<img src={props.Image} alt='Profile image'/>
			<h6>@{props.Username}sumit2232</h6>
			<p>{props.Message}this is amazing websitte i have ever seen and i tell you that do not take it seriuslly bye bye.</p>
			<em>Date: {props.Data}12-02-2021</em>
		</div>
	);
}

export default FeedbackCard;
